export interface SearchType {
  empty: string;
  filled: string;
  searchData: [];
}

export interface Indexable extends SearchType {
  [key: string]: string | [];
}

export const SearchReData = ({ empty, filled, searchData }: SearchType) => {
  const searchRec = searchData ? filled : empty;
  return searchRec;
};
